import React from 'react';
import './Home.css';

function HomePage() {
  return (
    <div className="home">
      <header className="home-header">
        <h1>Welcome to DevsOnDeck</h1>
        <p>Your platform for connecting developers and job opportunities.</p>
      </header>

      <section className="home-actions">
        <button className="home-button">For Developers</button>
        <button className="home-button">For Organizations</button>
      </section>

      <section className="home-why-us">
        <h2>Why Choose Us?</h2>
        <p>We simplify the process of connecting developers and recruiters for fast and efficient collaboration.</p>
      </section>

      <section className="home-cta">
        <button className="home-cta-button">Join Us Today</button>
      </section>
    </div>
  );
}

export default HomePage;
